import React from 'react';
import Item from '../Item';


const ImpressumPage = (props) => {
    return (
    
       <div className="mainContent">
              <Item header="Unser Standort:" content="" ><p>Treskowallee 8, 10318 Berlin</p><iframe title="frame" width="400" height="500" id="gmap_canvas" src="https://maps.google.com/maps?q=treskowallee%208%20berlin&t=&z=13&ie=UTF8&iwloc=&output=embed" frameborder="0" scrolling="no" marginheight="0" marginwidth="0"></iframe></Item>
              <Item header="Über uns:" content="Webtech Projekt" ><p>Nico Teichert <br/>Antoine Ma<br/>Kemal Solapgir<br/>Perica Glavas<br/></p></Item>
              <Item header="Rechtliche Hinweise:" content="" ><p>Die Inhalte unserer Internetseite werden mit größter Sorgfalt recherchiert. 
                    Dennoch kann der Anbieter keine Haftung für die Richtigkeit, 
                    Vollständigkeit und Aktualität der bereit gestellten Informationen übernehmen. 
                    Die Informationen sind insbesondere auch allgemeiner Art und stellen keine Rechtsberatung im Einzelfall dar. 
                    Zur Lösung von konkreten Rechtsfällen konsultieren Sie bitte unbedingt vorher einen Rechtsanwalt. 
                    Die Benutzung erfolgt ausschließlich auf eigenes Risiko.</p></Item>
            </div>

    );
};

export default ImpressumPage;
